import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import { AuthProvider } from './context/AuthContext';
import PrivateRoute from './component/PrivateRoute'; // Necesitarías implementar esto


import PetPage from "./pages/pet/Page/PagePet";
import CreatePetPage from "./pages/pet/CreatePage/CreatePagePet";
import DetailPetPage from "./pages/pet/DetailPage/DetailPagePet";
import RegisterUserPage from "./pages/user/Page/PageUser";

function App() {
  return (
    <div className="App">
      <BrowserRouter> 
        <AuthProvider>
        <Routes>
            <Route exact path='/' element={<PrivateRoute />}>
              <Route path="/pets" element={<PetPage />} />
              <Route path="/pets/addPet" element={<CreatePetPage />} />
              <Route path="/pets/detailPet/:idPet" element={<DetailPetPage />} />
            </Route>
            <Route path="/user" element={<RegisterUserPage />} />

        </Routes>
        </AuthProvider>
      </BrowserRouter>
    </div>
  );
}

export default App;
